import React from "react";

const Header = () => {
  return (
    <div className="header wrapper">
      <div className="logo">
        <h5>M</h5>
      </div>
      <div className="name-of-app">
          <br/>
        <h3>Timesaver Frontend</h3>
      </div>
    </div>
  );
};

export default Header;
